  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `episodes_movie_id_slug_index` (`movie_id`,`slug`),
  KEY `episodes_movie_id_index` (`movie_id`),
